Наш автосалон обеспечивает максимальную безопасность и уверенность при покупке автомобиля с пробегом.

- Автомобиль прошел комплексную техническую диагностику.

- Произведена полная предпродажная подготовка.

- На автомобиль предоставляется гарантия юридической чистоты (сертификат)

- Техническая гарантия на двигатель и КПП (1 год )

- Приглашаем Вас на бесплатный Тест-Драйв
Автомобиль можно приобрести за наличный расчет, безналичным платежом, также мы примем Ваш автомобиль по рыночной стоимости в рамках программы «Trade-in» в день обращения.
Техническая диагностика – мы проверили состояние всех наших автомобилей по 86 пунктам. Со всеми результатами диагностики Вы можете подробно ознакомиться у нас в салонах.

КАЖДОМУ ПОКУПАТЕЛЮ ИДЕТ ПОДАРОК НА ВЫБОР : - СТРАХОВКА НА АВТО; - НАБОР АВТОМОБИЛИСТА; - ВИДЕОРЕГИСТРАТОР; - НАВИГАТОР; - КОМПЛЕКТ РЕЗИНЫ ПО СЕЗОНУ; - ПОСТАНОВКА НА УЧЁТ.

- Выгода при покупке автомобиля по программе «Trade-in – выгодный обмен» до 50 000 рублей!

Данный автомобиль можно приобрести в кредит на ОСОБЫХ условиях от Банков Партнеров по двум документам:

— Первоначальный взнос от 0%;
— Срок кредита от 6 месяцев до 7 лет;
— Процентная ставка от 5,9% годовых;
— Оформление кредита по двум документам;
— Сумма кредита от 50 000 до 2 500 000 рублей;
— Досрочное погашение без штрафов и комиссий;
— Оформление КАСКО – по желанию;
— Без справок и поручителей.
